import {Book} from "./Book";

export function BookList({books = []}) {
  return (
      <div>
        <h1> 북 리스트 </h1>
        <div>
          {
            books ? books.map(v =>
                <Book {...v}/>
            ) : <h1> 데이터가 없습니다 </h1>

          }

        </div>
      </div>
  )
}
